import React from "react";
import './MyName.css'

function MyName() {
    function changeDate() {
        let firstName = document.getElementById("firstName").innerText;
        let lastName = document.getElementById("lastName");
        let name = firstName + lastName
        let a = document.getElementById("welcome").innerText(name)
    }

    return (
        <div className="MyName">
            <p className="MyName-test" id="welcome">Welcome! {document.getElementById("firstName")}</p>
            <h1 className="MyName-test">Personal Info</h1>
            <p className="MyName-title">FirstName:</p>
            <input type="text" className="MyName-input" id="firstName" defaultValue="易"/>
            <p className="MyName-title">Last Name:</p>
            <input type="text" className="MyName-input" id="lastName" defaultValue="阳"/><br/>
            <input type="submit" className="MyName-input" name="123" value="submit" on-Click="changeDate()"/>
        </div>
    );
}

export default MyName
